import React from 'react';
import {View, Text} from 'react-native';

import Cadastro from './src/pages/Cadastro'
import { NavigationContainer } from '@react-navigation/native';

const App = () => {

return (

  <NavigationContainer>
    <Cadastro/>
  </NavigationContainer>

);

}

export default App;
